    false,nt"url": null,nt"notes": "The Chicago Public Library has more than
    70 locations.   In January all branch locations were closed on Monday, January 9,
    Monday, January 23 and Monday, January 30. Beginning in February, all branch locations
    restored partial Monday hours, from 2 p.m. to 6 p.m. On June 18, all branch locations
    restored full Monday hours. Edgewater closed 6/16/11 for construction of a new branch
    scheduled to open in mid-2013. The libraryu2019s bookmobile opened 6/24/11 for Edgewater
    holds pickup and returns. Douglass closed for 10 days in February for roof repairs.
    Humboldt Park closed 3/26/12 for facility improvements and expansion. Lincoln Park
    closed for four days in August for replacement of the air conditioning system. Many
    locations experienced sporadic closures in summer 2012 due to air conditioning issues
    and area power outages. Albany Park closed 9/22/12 for construction of a new branch
    and will remain closed until 2014. Brighton Park, Jefferson Park and Portage Cragin
    were closed 11/26/12-12/7/12 for replacement of their HVAC systems.rntrn* Count
    does not reflect the total building visitor count due to location of traffic counter.
